import { Box, Center, SimpleGrid } from "@chakra-ui/react";


const Conta = () => {
    return(
        <Center>
            <SimpleGrid columns={2} spacing={8} paddingTop={16}>
                <Box backgroundColor='#ffffff' minHeight='120px'>
                    Informações do acesso
                </Box>
                <Box backgroundColor='#ffffff' minHeight='120px'>
                    Informações da conta
                </Box>
            </SimpleGrid>
        </Center>
    )
}

export default Conta;
